import React, { useEffect, useState } from 'react';
import { GoogleMap, useJsApiLoader, Marker, InfoWindow } from '@react-google-maps/api';
import axios from 'axios'

const containerStyle = {
    width: '100%',
    height: '100vh',
};

function MapComponent() {
    console.log('kimchi2')
    const [position, setPosition] = useState({
        lat: -3.745,
        lng: -38.523
    })
    const { isLoaded } = useJsApiLoader({
        id: 'google-map-script',
        googleMapsApiKey: "AIzaSyCuqNmuK8YHJn06WZwIkzZd2J8_XTJxpxM"
    })

    const mapRef = React.useRef(null);
    const [waypoints, setWayPoints] = React.useState([]);
    const [currPositionClicked, setCurrPositionClicked] = React.useState(false);
    const [activeMarkerHash, setActiveMarkerHash] = React.useState(null);

    useEffect(() => {
        // Update the document title using the browser API

    }, [waypoints]);

    const onTilesLoaded = React.useCallback(async function callback(map) {


        navigator.geolocation.getCurrentPosition((position) => {
            setPosition({ lat: position.coords.latitude, lng: position.coords.longitude });
            // doSomething(position.coords.latitude, position.coords.longitude);
            // this should be backend call
        });

        const bounds = mapRef.current.getBounds();
        console.log('kimchi5')
        console.log(mapRef)

        let boundaries = {
            northEastLat: bounds.getNorthEast().lat(),
            northEastLng: bounds.getNorthEast().lng(),
            southWestLat: bounds.getSouthWest().lat(),
            southWestLng: bounds.getSouthWest().lng()
        }
        console.log('kimchi 4' + boundaries.northEastLng);
        // await axios.post('http://localhost:5000/geocache', boundaries).then(response => {
        //     console.log("SUCCESS", response)
        //     setAllPositions(response)
        // }).catch(error => {
        //     console.log(error)
        // })

        await axios.get(`http://localhost:5000/geocache/${boundaries.northEastLat}/${boundaries.northEastLng}/${boundaries.southWestLat}/${boundaries.southWestLng}`).then(response => {
            console.log("SUCCESSGET", response)
            setWayPoints(response.data.message);
            console.log(response.data.message)
        }).catch(error => {
            console.log(error)
        })

        console.log(waypoints)

        console.log('kimin called')
    }, [setWayPoints, waypoints])

    const onLoad = React.useCallback(async function callback(map) {

        // This is just an example of getting and using the map instance!!! don't just blindly copy!
        navigator.geolocation.getCurrentPosition((position) => {
            setPosition({ lat: position.coords.latitude, lng: position.coords.longitude });
            // doSomething(position.coords.latitude, position.coords.longitude);
            // this should be backend call
        });
        const bounds = new window.google.maps.LatLngBounds(position);

        let boundaries = {
            northEastLat: bounds.getNorthEast().lat(),
            northEastLng: bounds.getNorthEast().lng(),
            southWestLat: bounds.getSouthWest().lat(),
            southWestLng: bounds.getSouthWest().lng()
        }
        console.log('kimchi 4' + boundaries.northEastLng);
        // await axios.post('http://localhost:5000/geocache', boundaries).then(response => {
        //     console.log("SUCCESS", response)
        //     setAllPositions(response)
        // }).catch(error => {
        //     console.log(error)
        // })

        await axios.get(`http://localhost:5000/geocache/${boundaries.northEastLat}/${boundaries.northEastLng}/${boundaries.southWestLat}/${boundaries.southWestLng}`).then(response => {
            console.log("SUCCESSGET", response)
        }).catch(error => {
            console.log(error)
        })

        map.fitBounds(bounds);

        mapRef.current = map;
    }, [])

    const onUnmount = React.useCallback(function callback(map) {
        mapRef.current = null;
    }, [])

    const currPositionSvgIcon = {
        path: "M-1.547 12l6.563-6.609-1.406-1.406-5.156 5.203-2.063-2.109-1.406 1.406zM0 0q2.906 0 4.945 2.039t2.039 4.945q0 1.453-0.727 3.328t-1.758 3.516-2.039 3.070-1.711 2.273l-0.75 0.797q-0.281-0.328-0.75-0.867t-1.688-2.156-2.133-3.141-1.664-3.445-0.75-3.375q0-2.906 2.039-4.945t4.945-2.039z",
        fillColor: "green",
        fillOpacity: 1,
        strokeWeight: 0,
        rotation: 0,
        scale: 2,
    };

    const onCurrPositionMarkerClick = (position) => {
        return <InfoWindow
            onCloseClick={() => {
            }}
            position={{
                lat: position.lat,
                lng: position.lng
            }}
        >
        </InfoWindow>
    };

    const userPositionOpen = () => {
        setCurrPositionClicked(true);
    };

    const userPositionClose = () => {
        setCurrPositionClicked(false);
    };

    const handleActiveMarker = (hash) => {

        // if (hash === activeMarkerHash) {
        //     return;
        // }
        setActiveMarkerHash(hash);
    };

    const unMounta =(hash) => {

        if (activeMarkerHash === hash) {
            setActiveMarkerHash(null)
        }
    }

    return isLoaded ? (
        <GoogleMap
            mapContainerStyle={containerStyle}
            center={position}
            zoom={4}
            onLoad={onLoad}
            onUnmount={onUnmount}
            onTilesLoaded={onTilesLoaded}
        >
            {waypoints.map(waypoint => {
                return <Marker position={{ lat: waypoint.lat, lng: waypoint.lng }} clickable={true}
                    onClick={() => setActiveMarkerHash(waypoint.hash)}>
                    {activeMarkerHash && activeMarkerHash === waypoint.hash ? (
                        <InfoWindow onCloseClick={() => setActiveMarkerHash(null)}>
                            <div>
                            {console.log(activeMarkerHash)}
                            {console.log(waypoint.hash)}   
                                <div>{waypoint.name}</div>
                                <div>Latitude: {waypoint.lat}</div>
                                <div>Longitude: {waypoint.lng}</div>
                            </div>
                        </InfoWindow>
                    ) : null}
                </Marker>
            })}
            {<Marker position={position} clickable={true} icon={currPositionSvgIcon} onClick={() => userPositionOpen()} >
                {currPositionClicked && (
                    <InfoWindow onCloseClick={() => userPositionClose()}>
                        <span>Current Location!</span>
                    </InfoWindow>
                )}
            </Marker>}
        </GoogleMap>
    ) : <></>
}

export default React.memo(MapComponent)
